import React, { Component, Fragment } from 'react'
import { Link } from 'react-router-dom';

export default class Nav extends Component {
  render() {
    return (
      <Fragment>
        <nav className='navbar is-fixed-top'>
          <div className='navbar-brand'>
            {/* <ul> */}
            <div className='navbar-start'>
              <li className='navbar-item'><Link to={'/'}>Home</Link></li>
              <li className='navbar-item'><Link to={'/login'}>Log In</Link></li>
              <li className='navbar-item'><Link to={'/signup'}>Sign Up</Link></li>
              <li className='navbar-item'><Link to={'/dashboard'}>Dashboard</Link></li>
              <li className='navbar-item'><Link to={'/browse'}>Browse</Link></li>
              <li className='navbar-item'><Link to={'/mygoals'}>My Goals</Link></li>
              {/* <li><Link to={' /'}>Home</Link></li> */}
            </div>
            <div className='navbar-end'>
              <li className='navbar-item'>Promise</li>
            </div>

            {/* </ul> */}
          </div>
        </nav>



      </Fragment >
    )
  }
}
